import React, { Component } from 'react';
import Social from './Social';
import logo from '../logo.svg';

class App extends Component {
  render() {
    return (
      <div>

        <ul className="header">
          <li><img src={logo} className="logo" alt="logo" /></li>
          <li><h1>DUBZOO</h1></li>
        </ul>

        <ul className="socials">
          <li><Social /></li>
          <li><Social /></li>
        </ul>

      </div>
    );
  }
}

export default App;
